import React from 'react';
import logo from './logo.svg';
import dino from './dino.png';
import {AnimateTo, AnimateFrom, AnimateConfig} from "@microsoft/fast-animation";

import './App.css';

class App extends React.Component {

   animate(){
    const myHtmlElement = document.querySelector("img");
    const myAnimation = new AnimateTo(myHtmlElement, {x: 800, y:5}, { duration: 10 });
    myAnimation.play();

    const myHtmlElement2 = document.getElementsById("App-link");
    const myAnimation2 = new AnimateTo(myHtmlElement2, {top: 800, left: 400}, { duration: 500 });
    myAnimation2.play();

    // const fadeOptions= new AnimateConfig ({ opacity: 0 });
    // new AnimateFrom(myHtmlElement2, fadeOptions, { duration: 100 }).play();

  };



  render() {
    return (
      <div className="App">
        <header className="App-header">
          {/* <img src={logo} className="App-logo" alt="logo" /> */}
          <img src={dino} id="dino" alt="dino" />
          <button onClick={this.animate}>
            Click Me
          </button>
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            id="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }

}


export default App;
